import React from 'react';
import Footer from '../../Footer';
import '../../../App.css';

function Hearth_bracelet_gold() {
  return (
    <>
      <div>
         <div class="w3-content w3-display-container">
            <img class="mySlides" src="img_snowtops.jpg" style="width:100%"></img>
            <img class="mySlides" src="img_lights.jpg" style="width:100%"></img>
            <img class="mySlides" src="img_mountains.jpg" style="width:100%"></img>
            <img class="mySlides" src="img_forest.jpg" style="width:100%"></img>
            <button class="w3-button w3-black w3-display-left" onclick="plusDivs(-1)">&#10094;</button>
            <button class="w3-button w3-black w3-display-right" onclick="plusDivs(1)">&#10095;</button>
          </div> 
      <Footer />
      </div>
    </>
  );
}

export default Hearth_bracelet_gold;
